// 该文件是整个项目的入口文件

// 引入Vue
import Vue from 'vue'
// 引入App组件，它是所有组件的父组件
import App from './App.vue'
// 关闭Vue的生产提示
Vue.config.productionTip = false
// 创建Vue的实例对象
new Vue({
    // 用于渲染页面结构
    render: h => h(App),
    // render完整写法：
    // render(createElement){
    //     return createElement('h1','你好啊')
    // }
}).$mount('#app')
